import React from 'react';
import './index.css';
import "@fontsource/odibee-sans";

//#region NAVBAR__CONTENT
const NAVBAR__LOGIC = () => {
  const [show, setShow] = React.useState(false);

  return (
  <header>
    <div className='relative w-full h-11 md:h-14 items-center grid grid-cols-2 md:grid-cols-3 justify-items-center'>
      <div className='fixed border flex text-2xl md:text-2xl italic decoration-2 navitem__home left-15'><a className='bg-white-500' href="/">Home</a></div>
        <div className='items-center justify-end md:justify-center flex md:center navbar__container'>
          {/* NAVBAR FOR MOBILE */}
          <nav className=''>
            <button className='translate-y-1 top-2 mr-5 md:hidden fixed right-0' id="hamburger" onClick={()=>setShow(!show)}>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white mb-1.5 w-7 h-1 rounded-md'></div>
              <div className='bg-white w-7 h-1 rounded-md'></div>
            </button>
            {show?<div className='bg-white bg-opacity-5 w-full mt-2 fixed justify-center items-center justify-items-center ' id="nav-ul">
              <ul className='w-32'>
              <li className='mt-2'>
              <div className='justify-center items-center justify-items-center text-xl bg-transparent fixed'><a href="#about__section">About Me</a></div>
              </li>
              <li className='mt-5'>
              <div className='justify-center items-center justify-items-center text-xl bg-transparent fixed'><a href="#about__section">Projects</a></div>
              </li>
              <li className='mt-5 mb-2'>
              <div className='justify-center items-center justify-items-center text-xl bg-transparent fixed'><a href="#contact__section">Contact</a></div> 
              </li>
            </ul>
            </div>:null}
          </nav>

          {/* NAVBAR FOR DESKTOP */}
          <NAVBAR__DESKTOP />
      </div>
    </div> 
  </header>);
}

const NAVBAR__DESKTOP = () => {
  return (
    <nav className='hidden md:grid grid-cols-3 w-full'>
      <div className='flex justify-center md:text-2xl'><a href="#about__section">About</a></div>       
      <div className='flex justify-center navitem__b'><a href="#projects__section">Projects</a></div>  
      <div className='flex justify-center navitem__b'><a href="#contact__section">Contact</a></div> 
    </nav>
  );
}

class NAVBAR extends React.Component {
  render() {
    return (
      <NAVBAR__LOGIC />
    );
  }
}
//#endregion NAVBAR__CONTENT

class BODY__CONTENT extends React.Component {
  render() {
    return (
      <div className='translate-y-24 md:mr-10 md:ml-10 items-center flex'>
        <div className='w-full'>
          <section id="about__section"></section>
          <div className='mt-14 ml-5 mr-5 flex justify-center w-fit text-3xl section__tag'>
            <h1>About Me</h1>
          </div>
          <div className='border mt-5 ml-20 mr-20'>
            About Me Content
          </div>

          <section id="projects__section"></section>
          <div className='mt-14 ml-5 mr-5 flex justify-center w-fit text-3xl section__tag'>
            <h1>Projects</h1>
          </div>
          <div className='mt-5 ml-10 mr-10 md:ml-20 md:mr-20 grid grid-cols-1 pcs:grid-cols-2 gap-y-5 pcs:gap-x-5'>
            <div className='border flex justify-center rounded-lg' id="proj_container">one</div>
            <div className='border flex justify-center rounded-lg' id="proj_container">one</div>
            <div className='border flex justify-center rounded-lg' id="proj_container">one</div>
            <div className='border flex justify-center rounded-lg' id="proj_container">one</div>
          </div>

          <section id="contact__section"></section>
          <div className='mt-14 ml-5 mr-5 flex justify-center w-fit text-3xl section__tag'>
            <h1>Contact</h1>
          </div>
          <div className='border mt-5 mb-14 ml-20 mr-20'>
            Contact Content
          </div>
        </div>
      </div>
    );
  }
}

function App() {
  return (
    <div className="App">
      <NAVBAR />
      <BODY__CONTENT />
    </div>
  );
}

export default App;
